import { SEARCH_WITH_NAME } from "../Constants/UserConstants";

export const Search_reducer =(state,action)=>{
switch (action.type) {
    case SEARCH_WITH_NAME:
        
        return {...state, searchinfo:state.payload}

    default:
        return state;
}
}
